import classes from './Cart.module.css';
import CartItem from './CartItem';

const Cart = (props) => {
    return <>
        <div className={classes['cart-container']}>
            <h2>Your Shopping Cart</h2>
            <CartItem item={{title: 'Test Item', quantity: 3, totalPrice: 18, price: 6}}/>
        </div> 
    </>
}

export default Cart;
